export const apiUsersTechnologiesCreateBodyLastNameMax = 150;
export const apiUsersTechnologiesCreateBodyStreakMin = -2147483648;

export const apiUsersTechnologiesCreateBodyStreakMax = 2147483647;
export const apiUsersTechnologiesCreateBodyKepcoinMin = -2147483648;

export const apiUsersTechnologiesCreateBodyKepcoinMax = 2147483647;

export const apiUsersTechnologiesCreateBody = zod.object({
  username: zod
    .string()
    .min(1)
    .max(apiUsersTechnologiesCreateBodyUsernameMax)
    .regex(apiUsersTechnologiesCreateBodyUsernameRegExp)
    .describe('Required. 150 characters or fewer. Letters, digits and @/./+/-/_ only.'),
  firstName: zod.string().max(apiUsersTechnologiesCreateBodyFirstNameMax).optional(),
  lastName: zod.string().max(apiUsersTechnologiesCreateBodyLastNameMax).optional(),
  streak: zod
    .number()
    .min(apiUsersTechnologiesCreateBodyStreakMin)
    .max(apiUsersTechnologiesCreateBodyStreakMax)
    .optional(),
  avatar: zod.string().min(1),
  kepcoin: zod
    .number()
    .min(apiUsersTechnologiesCreateBodyKepcoinMin)
    .max(apiUsersTechnologiesCreateBodyKepcoinMax)
    .optional(),
  skillsRating: zod.string().optional(),
  activityRating: zod.string().optional(),
});

